import React, { useEffect, useState } from "react";
import DataTable from "react-data-table-component";
import Tabletop from "tabletop";

function JuntaList(props) {
  const [data, setData] = useState([]);

  const columns = [
    {
      name: "Product",
      selector: "Product",
      sortable: true,
      width: "50%",
    },
    {
      name: "Industry",
      selector: "Industry",
      sortable: true,
      width: "50%",
    },
  ];

  useEffect(() => {
    Tabletop.init({
      key: "1l8JYfCSKMGYGjZ45XhGSmtwS9p8h82sZY9UAP1PaTL4",
      callback: (googleData) => {
        console.log("google sheet data --->", googleData);
        setData(googleData);
      },
      simpleSheet: true,
    });
  }, []);
  return (
    <div className="flex items-center justify-center">
      <div className="tailwindTable">
        <table className="w-full flex flex-initial flex-no-wrap sm:bg-white rounded-lg overflow-hidden sm:shadow-lg my-5">
          <thead>
            <tr className="bg-teal-400 flex flex-col flex-no wrap sm:table-row rounded-l-lg sm:rounded-none mb-2 sm:mb-0">
              <th className="p-3 text-left">ID</th>
              <th className="p-3 text-left">Product</th>
              <th className="p-3 text-left">Industry</th>
            </tr>
          </thead>
          <tbody className="flex-1 sm:flex-none">
            {data.map((obj) => {
              return (
                <tr
                  key={obj.ID}
                  className="bg-teal-400 flex flex-col flex-no wrap sm:table-row rounded-l-lg sm:rounded-none mb-2 sm:mb-0"
                >
                  <td className="p-3 text-left">{obj.ID}</td>
                  <td className="p-3 text-left">{obj.Product}</td>
                  <td className="p-3 text-left">{obj.Industry}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
      {/* <div className="inner w-full">
        <DataTable
          title="Stop Buying Junta Businesses"
          columns={columns}
          data={data}
          striped
          highlightOnHover
        />
      </div> */}
    </div>
  );
}

export default JuntaList;
